import React from "react";
import fetcher from "./functions/fetcher";
import formater from "./functions/formater";
import {
  Routes,
  Route,
  BrowserRouter,
  useNavigate
} from "react-router-dom";
import Main from "./screens/Main/index"
const App=()=> {
  return (<BrowserRouter>
      <div>hello world</div>
     <Routes>
      <Route path="/" element={<Main />} />
      <Route path="/hello" element={<p>hello</p>}/>
    </Routes>
  </BrowserRouter>)
}
export default App;
const AnotherPage=()=>{
  const clickHandler=()=>{
    let navigate = useNavigate();
    navigate(`/hello`);
  }
  <p onClick={clickHandler}>hello world2</p>
}
